#include <bits/stdc++.h>
using namespace std;
int main()
{
    int a, b, c1 = 0, c0 = 0;
    cin >> a >> b;
    if (b > (2 * a) + 2 or a > b + 1)
        return cout << -1, 0;
        
    if (b >= (2 * a))
        while(c1 != b or c0 != a)
        {
            if (c1 + 2 <= b) cout << "11", c1 += 2;
            else if (c1 + 1 <= b) cout << "1", c1++;
            if (c0 + 1 <= a) cout << "0", c0++;

        }
    else 
        while(c1 != b or c0 != a)
        {
            if (c0 + 1 <= a) cout << "0", c0++;
            if (c1 + 2 <= b and b - c1 > a - c0) cout << "11", c1 += 2;
            else if (c1 != b) cout << "1", c1++;
        }
}
